import styled from 'styled-components';
import { FaUser } from 'react-icons/fa';

const AvatarWrapper = styled.div`
  width: 100%;
  height: 100%;
`;

interface Props {
  profile: string;
}

const Avatar = ({ profile }: Props): JSX.Element => {
  return (
    <AvatarWrapper>
      {profile ? <img src={profile} alt="avatar" /> : <FaUser />}
    </AvatarWrapper>
  );
};

export default Avatar;
